import React from 'react'
import SujoySarkar from "../Assets/sujoy_sarkar.png"
function Profile() {
    return (
        <div style={{height:'150px', display:'flex',flexDirection:'column',alignItems:'center',justifyContent:'center'}}>
            <img src={SujoySarkar} style={{height:'80px'}}></img>
            <h1 style={{fontSize:'1rem',margin:'0', padding:'0',color:'white'}}>Sujoy Sarkar</h1>
            <p style={{fontSize:'0.9rem',margin:'0', padding:'0',color:'white'}}>Developer</p>
        </div>
    )
}

export default Profile
